script: |
  super -f text -I q1144.spq | sort > q1144.out

inputs:
  - name: q1144.spq
    data: |
      SELECT DISTINCT + col2 + - ( + + col2 ) AS col1 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT IN ( - - col1, col2, + 48, + 61, 53, - 41 );
  - name: tab0

outputs:
  - name: q1144.out
    data: |
